// SPDX-License-Identifier: MIT
pragma solidity >=0.8.0 <0.9.0;
import "@openzeppelin/contracts/token/ERC20/ERC20.sol";
import "hardhat/console.sol";

contract GNGToken is ERC20 {
    constructor() ERC20("GNG Token", "GNG") {
        _mint(address(this), 1000000000000000000000000);
    }

    /// @dev mints a given amount of tokens to the sender
    function transferAmount(address _address, uint amount) public {
        _transfer(address(this), _address, amount);
    }
}

